import{_ as e,o as i,c as t,S as o}from"./chunks/framework.7114eebe.js";const h=JSON.parse('{"title":"分享 11 张巨好看的PC端界面！！！","description":"","frontmatter":{"title":"分享 11 张巨好看的PC端界面！！！","date":"2023/04/23 11:30:02","summary":null,"config":{"show":true,"top":false,"dir":true,"dirTag":["h3","h4","h5"],"tag":["css","info"],"valine":true,"valineId":null},"password":false,"outline":[3,5]},"headers":[],"relativePath":"views/blog/css/FenXiang11ZhangJuHaoKanDePCDuanJieMian.md","filePath":"views/blog/css/FenXiang11ZhangJuHaoKanDePCDuanJieMian.md"}'),p={name:"views/blog/css/FenXiang11ZhangJuHaoKanDePCDuanJieMian.md"};function c(n,a,r,l,m,d){return i(),t("div",null,a[0]||(a[0]=[o('<h6 id="原文-掘金" tabindex="-1">原文 <a href="https://juejin.cn/post/7140193310966022175" target="_blank" rel="noreferrer">掘金</a> <a class="header-anchor" href="#原文-掘金" aria-label="Permalink to &quot;原文 [掘金](https://juejin.cn/post/7140193310966022175)&quot;">​</a></h6><h3 id="前言" tabindex="-1">前言 <a class="header-anchor" href="#前言" aria-label="Permalink to &quot;前言&quot;">​</a></h3><p>大家好，我是<strong>HoMeTown</strong>。</p><p>今天给大家带来了11张我觉得不论从<code>视觉效果</code>还是<code>页面布局</code>的维度都特别nice的11个pc偏管理端的界面，希望大家可以在平时开发没有灵感时用来做参考。</p><p>11张图里，我最喜欢的是<code>7森林</code>&amp;<code>9国际</code>，你喜欢哪种风格呢？评论区说一说吧！</p><h3 id="_1-悸动" tabindex="-1">1 悸动 <a class="header-anchor" href="#_1-悸动" aria-label="Permalink to &quot;1 悸动&quot;">​</a></h3><p>这个界面采用了粉色+紫色的双拼配色，给人一种特别有活力的感觉！ <img src="https://p3-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/8d678da566c641c092d8489c45ef15e0~tplv-k3u1fbpfcp-zoom-in-crop-mark:3024:0:0:0.image?" alt="image.png" loading="lazy"></p><h3 id="_2-简约" tabindex="-1">2 简约 <a class="header-anchor" href="#_2-简约" aria-label="Permalink to &quot;2 简约&quot;">​</a></h3><p>这个图排版布局上都很明显可以感觉到给人的舒适感。 <img src="https://p3-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/5cc69292d92f44238a8a4d5cd3c098cc~tplv-k3u1fbpfcp-zoom-in-crop-mark:3024:0:0:0.image?" alt="image.png" loading="lazy"></p><h3 id="_3-科技" tabindex="-1">3 科技 <a class="header-anchor" href="#_3-科技" aria-label="Permalink to &quot;3 科技&quot;">​</a></h3><p>这张图我总感觉有那种iOS的那种科技风，可以用来做电子产品的pc页面 <img src="https://p6-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/dcdd2ae88d79440b9a4dff038fea9c1f~tplv-k3u1fbpfcp-zoom-in-crop-mark:3024:0:0:0.image?" alt="image.png" loading="lazy"></p><h3 id="_4-橙光" tabindex="-1">4 橙光 <a class="header-anchor" href="#_4-橙光" aria-label="Permalink to &quot;4 橙光&quot;">​</a></h3><p>这张图的配色和布局我和之前一家公司的风格很像，做SaaS服务的经典配色。 <img src="https://p3-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/44b2c65ef22a4765ab0ec5e5e722e60e~tplv-k3u1fbpfcp-zoom-in-crop-mark:3024:0:0:0.image?" alt="image.png" loading="lazy"></p><h3 id="_5-柔和" tabindex="-1">5 柔和 <a class="header-anchor" href="#_5-柔和" aria-label="Permalink to &quot;5 柔和&quot;">​</a></h3><p>这张图看上去就比较柔和一点，除了左上角的卡片有点炸眼。 <img src="https://p6-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/ed662869eba643c9923d4e232a35a96d~tplv-k3u1fbpfcp-zoom-in-crop-mark:3024:0:0:0.image?" alt="image.png" loading="lazy"></p><h3 id="_6-森林" tabindex="-1">6 森林 <a class="header-anchor" href="#_6-森林" aria-label="Permalink to &quot;6 森林&quot;">​</a></h3><p>这个图就不用说了吧，是我最喜欢的颜色和风格，贴近大自然，强烈推荐👍🏻。 <img src="https://p6-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/1d1dc81bc258409c85ef53e483a44361~tplv-k3u1fbpfcp-zoom-in-crop-mark:3024:0:0:0.image?" alt="image.png" loading="lazy"></p><h3 id="_7-清新" tabindex="-1">7 清新 <a class="header-anchor" href="#_7-清新" aria-label="Permalink to &quot;7 清新&quot;">​</a></h3><p>这张图就很清新啦，适合做化妆品类的网站</p><p><img src="https://p6-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/cc4312360e1e45fc97249372c2f10942~tplv-k3u1fbpfcp-zoom-in-crop-mark:3024:0:0:0.image?" alt="image.png" loading="lazy"></p><h3 id="_8-传统" tabindex="-1">8 传统 <a class="header-anchor" href="#_8-传统" aria-label="Permalink to &quot;8 传统&quot;">​</a></h3><p>感觉这个风格有点点偏传统，但是又有一点科技风的感觉。 <img src="https://p1-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/81008a09a0e944488b0e63a7113d5e9b~tplv-k3u1fbpfcp-zoom-in-crop-mark:3024:0:0:0.image?" alt="image.png" loading="lazy"></p><h3 id="_9-国际" tabindex="-1">9 国际 <a class="header-anchor" href="#_9-国际" aria-label="Permalink to &quot;9 国际&quot;">​</a></h3><p>这张图有了上面几个card的颜色点缀，感觉瞬间提升b格。 <img src="https://p6-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/4a8393887a4c40b2acc605db9a322b78~tplv-k3u1fbpfcp-zoom-in-crop-mark:3024:0:0:0.image?" alt="image.png" loading="lazy"></p><h3 id="_10-丰富" tabindex="-1">10 丰富 <a class="header-anchor" href="#_10-丰富" aria-label="Permalink to &quot;10 丰富&quot;">​</a></h3><p>这张图的重点在布局，可以在页面元素多的时候，给我们一个参考。</p><p><img src="https://p3-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/d8dbe051bee6487b915d90357273d30a~tplv-k3u1fbpfcp-zoom-in-crop-mark:3024:0:0:0.image?" alt="image.png" loading="lazy"></p><h3 id="_11-简洁" tabindex="-1">11 简洁 <a class="header-anchor" href="#_11-简洁" aria-label="Permalink to &quot;11 简洁&quot;">​</a></h3><p>以单一的白色作为大背景色，崇尚极简！而且有没有人觉得右下角那个图有点像掘金的图？</p><p><img src="https://p6-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/4a1559cab2bc472a9317f5633a77d3d0~tplv-k3u1fbpfcp-zoom-in-crop-mark:3024:0:0:0.image?" alt="image.png" loading="lazy"></p><p>以上所有设计图均来自网络，如有侵权，请call我删除，感谢~</p>',31)]))}const g=e(p,[["render",c]]);export{h as __pageData,g as default};
